import React, { Component } from "react";
import Navbar from "react-bootstrap/Navbar";

class Welcome extends Component {
  state = {};
  render() {
    return (
      <Navbar>
        <Container>
          <Navbar.Brand href="#">I Study</Navbar.Brand>
        </Container>
      </Navbar>
    );
  }
}

export default Welcome;
